			~addr[8] & ~addr[7] & ~addr[6] & addr[5] & addr[3] & ~addr[2] & addr[1] |
			~addr[8] & ~addr[7] & ~addr[6] & addr[5] & ~addr[4] & addr[2] & addr[1] |
