function [2:0] selection;
  input [5:0] u_msbs;
  reg sign;    // complement - 1 when negative digit
  reg double;  // 2x value should be used
  reg zero;    // selection is a zero digit
  begin
   //////////////////////////////////////// 


    sign = u_msbs[5] & ~u_msbs[1] & ~u_msbs[0] |
			u_msbs[5] & ~u_msbs[2] |
			u_msbs[5] & ~u_msbs[4] |
			u_msbs[5] & ~u_msbs[3];

    double = u_msbs[5] & ~u_msbs[3] & ~u_msbs[0] |
			u_msbs[5] & ~u_msbs[3] & ~u_msbs[1] |
			u_msbs[5] & ~u_msbs[3] & ~u_msbs[2] |
			~u_msbs[5] & u_msbs[4] |
			~u_msbs[4] & u_msbs[3];

    zero = u_msbs[4] & u_msbs[3] & u_msbs[2] & u_msbs[0] |
			u_msbs[4] & u_msbs[3] & u_msbs[2] & u_msbs[1] |
			~u_msbs[4] & ~u_msbs[3] & ~u_msbs[2] & ~u_msbs[0] |
			~u_msbs[4] & ~u_msbs[3] & ~u_msbs[2] & ~u_msbs[1];
    selection = {sign,double,zero}; 
  end
endfunction

// Definition of signals
  reg signed [`u_size-1:0] u;
  reg [5:0] u_msbs;
  reg signed [`u_size-1:0] half;
  reg signed [`u_size-1:0] y;
  reg [op_width:0] result;
  reg [op_width-1:0] z_r4;
  reg [2:0] digit;
  reg sign, double, zero;
  reg [`r4table_addrsize-1:0] r4addr;
  reg [`u_size-1:0] sel_y;
  reg signed [`u_size-1:0] cmpl_y;
  integer i;
  reg signed [`u_size-1:0] r4table_info;
  reg [`sqrt_of_2_left:0] sqrt_of_2;

  always @ (a)
  begin
    sqrt_of_2 = 68'hB504F333F9DE64845;
    half = 0;
    half[`u_size-1-4] = 1'b1;
    
    u = $signed({1'b0,a,{`extra_bits{1'b0}}}) - half;
    u = u << 2;
    y = $signed({3'b000,sqrt_of_2[`sqrt_of_2_left:`sqrt_of_2_left-`u_size+4]});
    result = 0;
    for (i=1; i<= op_width/2+1; i=i+1)
    begin
      u_msbs =  u[`u_size-1:`u_size-1-6+1];
      digit = selection(u_msbs);
      sign = digit[2];
      double = digit[1];
      zero = digit[0];
      sel_y = (double)? 
		 ($unsigned($signed(y)>>>(2*i-1)) & {`u_size{~zero}}):
		 ($unsigned($signed(y)>>>(2*i)) & {`u_size{~zero}});
      cmpl_y = $signed(sel_y ^ {`u_size{sign}});
      y = y + cmpl_y + $signed({1'b0,sign});
      r4addr = {i,digit};
      r4table_info = log2_table(r4addr);
      u = (u + r4table_info) <<< 2;
    end  // for
    result = y[`u_size-1-3:`u_size-1-3-op_width]+1; 
    z_r4 = result[op_width:1];

end

